/// Converts an [`NerdIcon`] into a [`std::string::String`]
#[must_use]
pub fn icon_to_string(icon: NerdIcon) -> String {
    icon_to_char(icon).to_string()
}

impl From<NerdIcon> for char {
    fn from(icon: NerdIcon) -> Self {
        icon_to_char(icon)
    }
}

impl From<NerdIcon> for String {
    fn from(icon: NerdIcon) -> Self {
        format!("{}", icon_to_char(icon))
    }
}

impl std::fmt::Display for NerdIcon {
    fn fmt(&self, f: &mut std::fmt::Formatter<'_>) -> std::fmt::Result {
        write!(f, "{}", icon_to_char(*self))
    }
}
